package leetcode7_test

import (
	"testing"
)

func TestMax(t *testing.T) {
	args := []struct {
		name    string
		f       func(string, string) int64
		text    string
		pattern string
		want    int64
	}{
		{
			name:    "oneTest",
			f:       maximumSubsequenceCount,
			text:    "abdcdbc",
			pattern: "ac",
			want:    int64(4),
		},
		{
			name:    "twoTest",
			f:       maximumSubsequenceCount,
			text:    "aabb",
			pattern: "ab",
			want:    int64(6),
		},
		{
			name:    "threeTest",
			f:       maximumSubsequenceCount,
			text:    "",
			pattern: "zz",
			want:    int64(5000050000),
		},
		{
			name:    "fourTest",
			f:       maximumSubsequenceCount,
			text:    "jdxm",
			pattern: "pe",
			want:    int64(0),
		},
	}

	for _, v := range args {
		t.Run(v.name, func(t *testing.T) {
			if got := v.f(v.text, v.pattern); got != v.want {
				t.Errorf("%s -- got %v, want %v", v.name, got, v.want)
			}
		})
	}

}

func maximumSubsequenceCount(text string, pattern string) int64 {
	var degree int = 0
	idxL := []int{}
	idxR := []int{}
	for i := 0; i < len(text); i++ {
		if text[i] == pattern[0] {
			idxL = append(idxL, i)
		}
		if text[i] == pattern[1] {
			idxR = append(idxR, i)
		}
	}

	// log.Printf("%v idxL \n", idxL)
	// log.Printf("%v idxR \n", idxR)
	// 未放置情况下的最大组合
	if len(idxL) > 0 && len(idxR) > 0 {
		i, j := 0, 0
		lIdx := idxL[i]
		rIdx := idxR[j]
		for i < len(idxL) || j < len(idxR) {
			// 在 idx 中有先后顺序 可以便利 使用外部索引减少一个 循环
			// for _, vv := range idxR {
			// 	if v < vv {
			// 		degree++
			// 	}
			// }
			if lIdx < rIdx {
				degree += (len(idxR) - j)
				i++
				if i == len(idxL) {
					break
				}
				lIdx = idxL[i]
			} else {
				j++
				if j == len(idxR) {
					break
				}
				rIdx = idxR[j]
			}

		}
	}
	max := 0
	if len(idxL) > len(idxR) {
		max = len(idxL)
	} else {
		max = len(idxR)
	}

	return int64(degree + max)
}
